import { Card } from "../Components/Card";
import { Cards2 } from "../Components/Card2";
import { Card3 } from "../Components/Card3";
import { Cards } from "../Components/Cards";
import {
  MainPageContainer,
  MainPageTitleSection,
  MainPageLinks,
  Title,
  MainPageCardsSection,
  MainSection,
  Section,
  RedSection,
  YellowInnerSection,
  WhiteInnerSection,
} from "../Styles/Mainpage.style";

// import React, { useState, useEffect } from "react";
import axios from "axios";

function GetData() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const headers = {
        "x-access-token": "AYCe6lL4KhkuVTzJ31f/siKMucPrOdLE1LZfXv/oYGvFS7RF2JWr7OZijNIaz3TtrFvXZD1kpvWLAnUPln7WvQ==",
        "company-code": "GJ",
        "content-type": "application/json",
        "country": "611e04284ac17121fd8b1a54"
      };

      const body = {
        skip: 0,
        limit: 2,
        sort: "desc",
        sortBy: "createdAt"
      };

      const response = await axios.post("https://api.gamerji.tech/api/live-streamings/list", body, { headers });
      setData(response.data);
    };
    fetchData();
  }, []);

  return (
    <div>
      {data && (
        <div>
          <h2>Data:</h2>
          <p>{JSON.stringify(data)}</p>
        </div>
      )}
    </div>
  );
}

GetData();
export const Mainpage = () => {
  return (


    <MainPageContainer>
    <MainSection>
  <YellowInnerSection></YellowInnerSection>
  <WhiteInnerSection></WhiteInnerSection>
  </MainSection>
  <Section>
       <MainPageTitleSection>
        <div className="margin-auto"></div>
        <Title>Featured Video</Title>
        <div className="margin-auto"></div>
      </MainPageTitleSection>
      <Card />



      <MainPageTitleSection>
        <div className="margin-auto"></div>
        <Title>Popular Videos</Title>
        <MainPageLinks>View All</MainPageLinks>
      </MainPageTitleSection>
      <MainPageCardsSection>
        <Cards/>
      </MainPageCardsSection>

      <MainPageTitleSection>
        <div className="margin-auto"></div>
        <Title>Top Profiles</Title>
        <MainPageLinks>View All</MainPageLinks>
      </MainPageTitleSection>
      <MainPageCardsSection>
        <Card3/>
      </MainPageCardsSection>


      <MainPageTitleSection>
        <div className="margin-auto"></div>
        <Title>eSports News</Title>
        <MainPageLinks>View All</MainPageLinks>
      </MainPageTitleSection>
      <MainPageCardsSection>
        <Cards2/>
      </MainPageCardsSection>
      </Section>
    </MainPageContainer>

  );
};
